import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/common/Header';
import Footer from './components/common/Footer';
import Home from './pages/Home';
import Locations from './pages/Locations';
import LocationDetails from './pages/LocationDetails';
import Login from './pages/Login';
import Reservations from './pages/Reservations';

// Admin Components
import AdminDashboard from './components/admin/Dashboard';
import CreateListing from './components/admin/CreateListing';
import ViewListings from './components/admin/ViewListings';
import UpdateListing from './components/admin/UpdateListing';

// Host Components
import HostDashboard from './components/host/Dashboard';
import HostReservations from './components/host/HostReservations';

// User Components
import UserDashboard from './components/user/Dashboard';

import { AuthProvider } from './utils/AuthContext';
import ProtectedRoute from './utils/ProtectedRoute';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="flex flex-col min-h-screen">
          <Header />
          <main className="flex-grow">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/locations" element={<Locations />} />
              <Route path="/locations/:id" element={<LocationDetails />} />
              <Route path="/login" element={<Login />} />
              <Route path="/reservations" element={<ProtectedRoute><Reservations /></ProtectedRoute>} />

              {/* Admin Routes */}
              <Route path="/admin" element={<ProtectedRoute requiredRole="admin"><AdminDashboard /></ProtectedRoute>} />
              <Route path="/admin/create-listing" element={<ProtectedRoute requiredRole="admin"><CreateListing /></ProtectedRoute>} />
              <Route path="/admin/listings" element={<ProtectedRoute requiredRole="admin"><ViewListings /></ProtectedRoute>} />
              <Route path="/admin/update-listing/:id" element={<ProtectedRoute requiredRole="admin"><UpdateListing /></ProtectedRoute>} />

              {/* Host Routes */}
              <Route path="/host" element={<ProtectedRoute requiredRole="host"><HostDashboard /></ProtectedRoute>} />
              <Route path="/host/create-listing" element={<ProtectedRoute requiredRole="host"><CreateListing /></ProtectedRoute>} />
              <Route path="/host/listings" element={<ProtectedRoute requiredRole="host"><ViewListings /></ProtectedRoute>} />
              <Route path="/host/listings/:id/edit" element={<ProtectedRoute requiredRole="host"><UpdateListing /></ProtectedRoute>} />
              <Route path="/host/reservations" element={<ProtectedRoute requiredRole="host"><HostReservations /></ProtectedRoute>} />

              {/* User Routes */}
              <Route path="/user" element={<ProtectedRoute requiredRole="user"><UserDashboard /></ProtectedRoute>} />
            </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
